		<div className="sign-form">
			<SignIn onRouteChange={this.onRouteChange} backClickChange={this.backClick} />
            <SignUp loadUser={this.loadUser} onRouteChange={this.onRouteChange} loginClickChange={this.test} />
		</div>
		);
	}
}

